query:
mutation containerFqdnCreateFromFile ( $createFqdnContainerFromFileInput:CreateFqdnContainerFromFileInput! $accountId:ID! ) {
	container ( accountId:$accountId ) {
		fqdn  {
			createFromFileFqdnContainerMutations: createFromFile ( input:$createFqdnContainerFromFileInput   ) {
				container  {
					id
					name
					description
					size
					auditFqdnContainer: audit {
						createdBy 
						lastModifiedBy 
						lastModifiedAt 
						createdAt 
					}
				}

			}
		}

	}	
}
